    }

   componentDidMount() {	
   }

	render() {
		return (
			<Main>
                <FlexRow>
                    <FlexChild>

                    </FlexChild>
                    <FlexChild>

                    </FlexChild>
                </FlexRow>
			</Main>
		);
	}
}

function mapStateToProps(state) {
	return {
	}
}
function mapDispatchToProps(dispatch) {
	return {
	}
}

export default connect(mapStateToProps, mapDispatchToProps)(TestPassPanel)
